function checkForm() {
    searchText = document.f1.SEARCH.value.trim();
    document.f1.SEARCH.value = searchText;
    sti = parseInt(searchText);
    if (sti > 0) {
        document.f1.SEARCH.value = sti;
        return true;
    } else if (searchText.length > 0 && searchText.length < 4) {
        alert('Please enter at least 4 characters');
        return false;
    } else {
        return true;
    }
}
